-- ----------------------------
-- Table structure for gateway_diag_latest
-- ----------------------------
DROP TABLE IF EXISTS `gateway_diag_latest`;
CREATE TABLE `gateway_diag_latest` (
  `latest_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键：最新值行ID（自增，仅用于本表内部标识）',
  `slave_id` bigint(20) unsigned NOT NULL COMMENT '子站配置ID → gateway_slave.slave_id（两表关联字段，同名更清晰）',
  `error_word_dec` int(11) NOT NULL COMMENT '错误位图所在word地址（COM1:8192/8193；COM2:8194/8195）',
  `error_bit` tinyint(4) NOT NULL COMMENT '错误位图中的位索引(0..15)，由站号换算',
  `error_flag` tinyint(1) NOT NULL COMMENT '该从站是否通信错误：对应error_bit是否置1（0/1）',
  `status_word_dec` int(11) NOT NULL COMMENT '状态字所在word地址（COM1：8207+(站-2)；COM2：8269+(站-1)）',
  `status_raw` int(11) NOT NULL COMMENT '状态字原值(0..65535)',
  `status_func` tinyint(4) NOT NULL COMMENT '状态字高字节（功能码/类型码）= (status_raw>>8)&0xFF',
  `status_exc` tinyint(4) NOT NULL COMMENT '状态字低字节（异常/错误码）= status_raw&0xFF',
  `poll_ms` int(11) DEFAULT NULL COMMENT '本次采集耗时或轮询周期（毫秒）',
  `latency_ms` int(11) DEFAULT NULL COMMENT '读取延迟/网络往返（毫秒）',
  `src` varchar(16) DEFAULT 'poll' COMMENT '数据来源：poll/trap/manual 等',
  `read_ts` datetime NOT NULL COMMENT '读取时间（服务端/系统时间）',
  PRIMARY KEY (`latest_id`) USING BTREE,
  UNIQUE KEY `uk_slave` (`slave_id`) COMMENT '同一从站仅保留一行最新值',
  KEY `idx_read_ts` (`read_ts`),
  CONSTRAINT `fk_latest_slave` FOREIGN KEY (`slave_id`) REFERENCES `gateway_slave` (`slave_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='【结果表】每个从站的“最新”诊断值（错误位/状态字）；通过 slave_id 关联配置表';

-- ----------------------------
-- Records of gateway_diag_latest
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for gateway_slave
-- ----------------------------
DROP TABLE IF EXISTS `gateway_slave`;
CREATE TABLE `gateway_slave` (
  `slave_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键：子站配置ID（与结果表的外键同名，便于理解）',
  `device_id` int(11) DEFAULT NULL COMMENT '设备ID',
  `gateway_ip` varchar(64) NOT NULL COMMENT '网关IP地址（Modbus TCP 连接用）',
  `unit_id` smallint(5) unsigned NOT NULL COMMENT '网关主站号(UnitID)，Modbus TCP 报文中的 Unit ID',
  `com` enum('COM1','COM2') NOT NULL COMMENT '串口口号：COM1 或 COM2',
  `slave_no` smallint(5) unsigned NOT NULL COMMENT '从站号(1..247)，与 com 一起标识485链路上的具体设备',
  `label` varchar(128) NOT NULL COMMENT '点位/设备名称（例：P101_T / FIT111-总出水 等）',
  `category` varchar(32) DEFAULT NULL COMMENT '自定义分类（T/FIT/BP/KIT/泵/阀…），用于分组/过滤',
  `blocks_json` json DEFAULT NULL COMMENT '【可选】过程量寄存器块配置（诊断区不在此存）：如 [{"fc":3,"start":1004,"quantity":13,"mg":"0001","desc":"BP块"}]',
  `enabled` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否启用：1=启用（采集+诊断），0=停用（采集跳过）',
  `remarks` varchar(512) DEFAULT NULL COMMENT '备注：位置/检修原因/字节序或系数/工单编号等',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  PRIMARY KEY (`slave_id`),
  UNIQUE KEY `uk_gw_com_slave` (`gateway_ip`,`unit_id`,`com`,`slave_no`) COMMENT '同一网关+口+站 唯一',
  KEY `idx_gateway` (`gateway_ip`,`unit_id`)
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8mb4 COMMENT='【配置表】网关子站清单：网关IP+UnitID+COM+站号+名称；诊断地址运行时按规则计算';

-- ----------------------------
-- Records of gateway_slave
-- ----------------------------
BEGIN;
COMMIT;

